"original": |2-
     The proxy is currently unable to handle the request due to a
     temporary overloading or maintenance of the proxy.  The implication
     is that this is a temporary condition that will be alleviated after
     some delay.  If known, the length of the delay MAY be indicated in a
     Retry-After header.  If no Retry-After is given, the agent SHOULD
     handle the response as it would for a 500 response.  The agent MUST
     honor the length, if given in the Retry-After header.
"fixed": |-
  The proxy is currently unable to handle the request due to a temporary overloading or maintenance of the proxy.  The implication is that this is a temporary condition that will be alleviated after some delay.  If known, the length of the delay MAY be indicated in a Retry-After header.  If no Retry-After is given, the agent SHOULD handle the response as it would for a 500 response.  The agent MUST honor the length, if given in the Retry-After header.
"ko": |-
  일시적인 과부하 또는 프록시 유지 관리로 인해 현재 프록시가 요청을 처리할 수 없습니다. 이는 이것이 약간의 지연 후에 완화될 일시적인 상태라는 것을 의미합니다. 알려진 경우 지연 길이는 Retry-After 헤더에 표시될 수 있습니다. Retry-After가 제공되지 않으면 에이전트는 500 응답과 마찬가지로 응답을 처리해야 합니다. 에이전트는 Retry-After 헤더에 제공된 경우 길이를 존중해야 합니다.
